import React, { Component } from 'react';

import axios from 'axios';


class userdata extends Component {
    constructor(props) {
        super(props);
        this.state = {users:[]}
    }
  
    

    componentDidMount() {axios.get('https://fakestoreapi.com/users')
    .then((apiresult)=>this.setState({users:apiresult.data}))

    }

    
    render() {
        return (
            <div>
                
              <h2>Selected Id Parameter For users only</h2>
              <table className="w-40 mx-auto table  table-bordered table-bark">
                  <tbody>
                  {this.state.users.map( (res,index)=>{
                      <tr>
                          <th>EMPID</th>
                          <td>{res.id}</td>
                      </tr>
                  })}
                  </tbody>
              </table>
            </div>
        );
    }
}



export default userdata;
